import React from 'react';
import { Text, View } from 'react-native';
import LevelScreen from './LevelScreen';

function Level1() {
  return (
    <View>
      {/* Other components and content */}
      <Text>This is Level 1</Text>
      <LevelScreen />
    </View>
  );
}

export default Level1;
